  namespace: H.Drawing3D.Shape.File.Importers
  summary: Gets or sets a value indicating whether to skip transparency values in the material files.
  remarks: >-
    This option is added to allow disabling the <pre><code class="lang-csharp">Tr</code></pre> values in files where it has been defined incorrectly.

    The transparency values (<pre><code class="lang-csharp">Tr</code></pre>) are interpreted as 0 = transparent, 1 = opaque.

    The dissolve values (<pre><code class="lang-csharp">d</code></pre>) are interpreted as 0 = transparent, 1 = opaque.
  example: []
  syntax:
    content: public bool SkipTransparencyValues { get; set; }
    parameters: []
    return:
      type: System.Boolean
      description: <code>true</code> if transparency values should be skipped; otherwise, <code>false</code>.
